                "Desc": "忍法 · 嗚呼流の独創奥義！疾風の如く速さで戦場を馳せる！<br>体を丸め、高速回転する風々輪となり突進する。命中した敵に<color style='color:#80FFD7;'>風元素ダメージ</color>を与え、スキル終了時に風々輪 · 旋舞蹴を繰り出し、<color style='color:#80FFD7;'>風元素範囲ダメージ</color>を与える。<br><br><color style='color:#FFD780;'>一回押し</color><br>風々輪状態になり、前方へ転がり、風々輪 · 旋舞蹴を繰り出す。<br><br><color style='color:#FFD780;'>長押し</color><br>風々輪状態で転がり続ける。早柚の中断耐性がアップする。<br>継続時間中、早柚は突進方向を変えることができ、再び発動することでスキルを早めに終了して、一回押しより強力な風々輪 · 旋舞蹴を繰り出す。<br>長押しによって発動した時、元素変化が起きる。<br><br>最大10秒継続することが可能。スキル終了時にクールタイムに入る。風々輪状態の継続時間が長いほど、クールタイムは長くなる。<br><br><color style='color:#FFD780;'>元素変化</color><br>風々輪状態の早柚が<color style='color:#80C0FF;'>水元素</color>/<color style='color:#FF9999;'>炎元素</color>/<color style='color:#99FFFF;'>氷元素</color>/<color style='color:#FFACFF;'>雷元素</color>に接触すると、接触した元素の属性を獲得し、風々輪と風々輪 · 旋舞蹴は該当元素ダメージを追加で与える。<br>元素変化はスキル継続中に1回のみ発生する。<br><br><i>目をつぶった状態でも繰り出せる早柚の得意技。本来は逃げるために使っていたが、神の目を持つ今は、敵を懲らしめる時にも使えるようになった。</i>",
