                "Desc": "チーム全員の元素タイプが<color style='color:#99FF88;'>草元素</color>と<color style='color:#80C0FF;'>水元素</color>であり、かつ草元素と水元素のキャラクターが少なくとも一人ずついる時、ニィロウの<color style='color:#FFD780;'>七域のダンス</color>の3段目のステップが完了すると、周囲のチーム全員に「金盃の豊穣」状態を付与する、継続時間30秒。<br>金盃の豊穣状態のキャラクターが<color style='color:#99FF88;'>草元素の攻撃</color>を受けた後、周囲のチーム全員の元素熟知+100、継続時間10秒。また、開花反応を起こした時、草原核の代わりに「豊穣の核」が生成される。<br>草原核に比べ、豊穣の核は生成された直後に迸り、より大きな影響範囲を持つ。<br>豊穣の核は超開花反応と烈開花反応を起こすことができず、草原核と上限数を共有する。豊穣の核の攻撃は、開花反応による草原核の攻撃と見なされる。<br>チーム内キャラクターの元素タイプが固有天賦の条件を満たさない場合、既存の金盃の豊穣効果はクリアされる。",
