                "Name": "浄善摂受明論",
                "Desc": "<color style='color:#FFD780;'>心景幻成</color>発動時、摩耶の宮殿は下記効果を獲得する。<br>チーム内にいる元素熟知の最も高いキャラクターを参照し、その元素熟知の25%を基にフィールド上の領域内キャラクターの元素熟知をアップする。<br>この方法でアップできる元素熟知は最大250までとなる。",
