                "Desc": "安眠天幕シールドを展開し、<color style='color:#99FFFF;'>氷元素範囲ダメージ</color>を与える。<br>安眠天幕シールドのダメージ吸収量はレイラのHP上限によって決まり、<color style='color:#99FFFF;'>氷元素ダメージ</color>に対しては250%の吸収効果を持つ。またシールド生成時、レイラに短時間の<color style='color:#99FFFF;'>氷元素付着</color>を与える。<br><br><color style='color:#FFD780;'>夜星と飛星</color><br>安眠天幕シールドは継続している間、1.5秒ごとにシールドに寄り添う夜星を1つ生成する。このシールド状態のキャラクターが元素スキルを発動すると夜星が2つ生成され、0.3秒ごとにこの方法で夜星を最大1回生成できる。また、同時に存在できる夜星の上限は4つとなる。<br>安眠天幕シールドの夜星が4つになり、かつ近くに敵がいる場合、夜星は自動索敵する飛星に変わって順次発射され、命中した敵に<color style='color:#99FFFF;'>氷元素ダメージ</color>を与える。<br>安眠天幕シールドの継続時間が終了、またはシールドが破壊された時、夜星は共に消える。夜星がすでに飛星に変わって発射を開始していた場合、飛星はそのラウンドの発射が終了するまで存在し続ける。<br><br>1ラウンドの飛星が全部発射されるまで、新しい夜星は生成されない。<br><br><i>「あたしとこの子は見ず知らずの熟練職人同士のように、同じ座布団に座って、同じ夢の花を刺繍している。」</i>",
