                "Desc": "<color style='color:#FFD780;'>通常攻撃</color><br>最大4段の連続射撃を行う。<br><br><color style='color:#FFD780;'>落下攻撃</color><br>空中から矢の雨を放ち、凄まじいスピードで落下し地面に衝撃を与え、落下時に範囲ダメージを与える。<br><br><color style='color:#FFD780;'>重撃</color><br>ダメージがより高く、より精確な<color style='color:#FFD780;'>狙い撃ち</color>を発動する。<br>照準時、炎の力が矢先に集まり、攻撃と共に発射される。チャージの時間により、異なる効果を発動する。<br> · 1段チャージ：炎元素が集まった矢を放ち、<color style='color:#FF9999;'>炎元素ダメージ</color>を与える。<br> · 2段チャージ：プロップアローを放ち、<color style='color:#FF9999;'>炎元素ダメージ</color>を与え、命中後に「ファニーキャット · ハット」を1個召喚する。<br>プロップアローを発射する時、リネのHPが60%を超えている場合、リネは一定のHPを消費して「プロップ残数」を1層獲得する。最大5層まで。戦闘状態が解除されてから30秒後、該当効果はクリアされる。<br>この方法によるHP消費によって、リネの残りHPが60%を下回ることはない。<br><br><color style='color:#FFD780;'>ファニーキャット · ハット</color><br> · 周囲の敵を挑発し、攻撃を引き付ける。各敵は5秒毎に一度だけ、ファニーキャット · ハットに挑発される。<br> · 耐久度はリネのHP上限によって決まる。<br> · 破壊された時、または継続時間終了後、周囲の敵1体に向かって<color style='color:#FFD780;'>クラッカーバレット</color>を放ち、<color style='color:#FF9999;'>炎元素ダメージ</color>を与える。<br>ファニーキャット · ハットは同時に最大1個まで存在可能。<br><br><color style='color:#FFD780;'>アルケー：プネウマ</color><br>プロップアローが命中した位置に霊息の棘を降らせ、プネウマを帯びた<color style='color:#FF9999;'>炎元素ダメージ</color>を与える。一定時間ごとに発動が可能。",
