                        "Desc": "Using the keen instincts of an ace reporter, Charlotte uses her photography skills to produce different effects based on whether the ability is tapped or held.<br><br><color style='color:#FFD780;'>Tap</color><br>Takes a snapshot using Monsieur Verite, dealing <color style='color:#99FFFF;'>AoE Cryo DMG</color> to opponents in front of her and applying Snappy Silhouette to a maximum of 5 opponents. During this effect's duration, it will deal <color style='color:#99FFFF;'>Cryo DMG</color> to affected opponents at intervals.<br><br><color style='color:#FFD780;'>Hold</color><br>Popping Monsieur Verite's viewfinder open, Charlotte enters Composition Mode, and during this time, the viewfinder will expand as you hold until you reach a Finisher Frame state. In this state, Charlotte can move and change direction freely.<br>When the hold state ends, Monsieur Verite will deal <color style='color:#99FFFF;'>Cryo DMG</color> to all opponents locked on within the viewfinder, and apply the same Snappy Silhouette as Tap Mode does to them. If you unleash this ability only after reaching Finisher Frame, you will instead apply Focused Impression, which lasts longer and deals more DMG, although the Skill CD will be longer.<br>Composition Mode lasts a maximum of 15s and allows a maximum of 5 opponents to be selected.<br><br><i>\"Press photography requires simple shots with exceptional theming, but most of all, you need to have a knack for capturing the moment!\"</i>",
